import React, {useContext} from 'react';
import {Context} from "../index";
import { ListGroup } from 'react-bootstrap';
import {observer} from "mobx-react-lite";

const TypePic = observer(() => {
    
    
    const sort = () =>{
        if (photo._photo.type === this.name){
            console.log(photo._photo);
        }
    }


    const {photo}=useContext(Context);
    //console.log(pic);
    return (
        <ListGroup className='mt-5'>
            {photo._types.map(type=>
                <ListGroup.Item key={type.id} action variant="secondary" onClick={()=>sort()}>
                    {type.name} 
                </ListGroup.Item>
            )}
  
    </ListGroup>
    );

});

export default TypePic;
